(1328, 15, 1317, 48, NULL, '3.2.11.', NULL, 'Despesa', 'Conservação de Móveis e Utensílios', 'Gastos com prestadores de serviço e materiais necessários ao conserto de móveis e utensílios de escritório. Ex: mesas, cadeiras, relógio de parede, sofás etc.', NULL, '2018-08-01 02:01:56', '2018-08-01 02:01:56'),
(1329, 15, 1317, 48, NULL, '3.2.12.', NULL, 'Despesa', 'Conservação de Máquinas e Equipamentos', 'Gastos com prestadores de serviço e materiais, peças e acessórios necessários ao conserto e revisão de máquinas e equipamentos. Inclui equipamentos de processamento de dados, PABX, scanner, impressoras, projetor, bebedouro, interfone, computadores, réguas de energia e adaptadores (benjamins), etc.', NULL, '2018-08-01 02:01:56', '2018-08-01 02:01:56'),
