INSERT INTO `sis_apresentacaos` (`id`, `sis_modulo_id`, `titulo`, `descricao`, `style`, `route`, `status`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 4, 'Modulo Financeiro', 'No <em>Modulo Financeiro</em> a interface permite gerenciar as contas a pagar e as contas a receber.', NULL, NULL, 1, NULL, NULL, NULL),
(2, 4, 'Menu Modulo', 'Em <em>Menu Modulo</em> a mostra.', '.spotlight-lens {\n      height: 52px;\n      width: 190px;\n      margin-top: 3px;\n      right: -3px;\n      border-radius: 0;\n      -webkit-transition: right 1s, margin-top 1s, border-radius 1s;\n      transition: right 1s, margin-top 1s, border-radius 1s;\n    }\n\n    .spotlight-lens:before {\n      height: 50px;\n      width: 188px;\n      border-radius: 0px;\n      -webkit-transition: height 1s, width 1s, border-radius 1s;\n      transition: height 1s, width 1s, border-radius 1s;\n      \n    }\n\n    .spotlight-lens:after {\n      border-radius: 0px;\n      -webkit-transition: border-radius 1s;\n      transition: border-radius 1s;\n    }\n\n    .spotlight-teaser {\n      left: -630px!important;\n      text-align: right;\n    }', NULL, 1, NULL, NULL, NULL),
(3, 4, 'Configurações', 'Em <em>Inserir Item</em> criação de novo Banco', '.spotlight-lens {\n    margin-top: 123px;\n}', NULL, 1, NULL, NULL, NULL),
(4, 4, 'Fluxo de Caixa Diário', 'O Fluxo de Caixa Mensal é um relatório que apresenta as entradas e saídas financeiras da empresa, indicando qual o saldo em caixa em um determinado período.<br>Para visualizar o relatório, acesse: Relatórios > Financeiro > Fluxo caixa mensal', '.spotlight-lens { height: 38px;width: 67px;margin-top: 67px;left: 108px;border-radius: 0;-webkit-transition: right 1s, margin-top 1s, border-radius 1s;transition: right 1s, margin-top 1s, border-radius 1s; }\r\n.spotlight-lens:before { height: 36px;width: 65px;border-radius: 0px;-webkit-transition: height 1s, width 1s, border-radius 1s;transition: height 1s, width 1s, border-radius 1s;}\r\n.spotlight-lens:after { border-radius: 0px;-webkit-transition: border-radius 1s;transition: border-radius 1s; }\r\n.spotlight-teaser { left: 70px!important;text-align: left; }', NULL, 1, NULL, NULL, NULL);
